import React, {Component} from 'react'


export default class Cart extends Component {



    constructor(props) {
        super(props)
    }





    render() {

        const cartPrice=0;
        const cartList=[]; 

        for (var key in this.props.cartList) {
            const item=this.props.cartList[key] 

            if(item != null) {
                cartPrice += (item.price) * (item.quantity)
                cartList.push(
                    <div class = "eachcard">
                    <div>
                        <b>{item.name}</b>
                    </div>

                    <div class = "pic">
                        <img src ={item.img}/>
                    </div>

                    <div>
                        <b>Pet Type: </b> {item.type}
                    </div>

                    <div>
                        <b>Exotic Level: </b> {item.exotic}
                    </div>

                    <div>
                        <b>Token Price: </b> {item.price}
                    </div>

                    <center>
                        <button class="addcartbutton" onSubmit={this.props.addItem(item.name, item.img, item.type, item.exotic, item.price)}>
                            Add To Cart
                        </button>
                    </center>
                </div>
                )
            }
        }







        return (


            <div class="cartbox">

                <h1>Pet Cart</h1>

                <div>
                    Total Token Price: {this.props.aggregator}
                </div>

                <div>
                    {cartList}
                </div>
            </div>

        )
    }
}
